  namespace: NDSH.Geospatial.Gml.Dictionary
  summary: A <xref href="NDSH.Geospatial.Gml.Dictionary.DictionaryEntryType" data-throw-if-not-resolved="false"></xref> contains or refers to the definitions which are members of a dictionary.
  remarks: >-
    <p>
      The content model follows the standard GML property pattern, so a <xref href="NDSH.Geospatial.Gml.Dictionary.DictionaryEntryType" data-throw-if-not-resolved="false"></xref>
      may either contain or <xref href="NDSH.Geospatial.Gml.Dictionary.DefinitionType" data-throw-if-not-resolved="false"></xref> refer to a single <xref href="NDSH.Geospatial.Gml.Dictionary.DefinitionType" data-throw-if-not-resolved="false"></xref>.
      Since <xref href="NDSH.Geospatial.Gml.Dictionary.DictionaryType" data-throw-if-not-resolved="false"></xref> is substitutable for <xref href="NDSH.Geospatial.Gml.Dictionary.DefinitionType" data-throw-if-not-resolved="false"></xref>,
      the content of an entry may itself be a lower level dictionary.
    </p>

    <p>
      Note that if the value is provided by reference, this definition does not carry a handle (gml:id)
       in this context, so does not allow external references to this specific definition in this context.
       When used in this way the referenced definition will usually be in a dictionary in the same XML document.
    </p>
  example: []
